pub enum Procedure {
    SLIP10Generate {
        output: Location,
        hint: RecordHint,
        size_bytes: Option<usize>,
    },
    SLIP10Derive {
        chain: Chain,
        input: SLIP10DeriveInput,
        output: Location,
        hint: RecordHint,
    },
    BIP39Recover {
        mnemonic: String,
        passphrase: Option<String>,
        output: Location,
        hint: RecordHint,
    },
    BIP39Generate {
        passphrase: Option<String>,
        output: Location,
        hint: RecordHint,
    },
    BIP39MnemonicSentence {
        seed: Location,
    },
    Ed25519PublicKey {
        private_key: Location,
    },
    Ed25519Sign {
        private_key: Location,
        msg: Vec<u8>,
    },
}

pub enum Location {
    Generic {
        vault_path: Vec<u8>,
        record_path: Vec<u8>,
    },
    Counter {
        vault_path: Vec<u8>,
        counter: usize,
    },
}
